#include <iostream>
#include <cstdlib>
#include <utility>
#include <vector>

struct ListNode
{
    int val;
    ListNode* next;
    ListNode(int x): val(x), next(NULL) {}
};

class QuickSort
{
public:
    ListNode* sortList(ListNode *head)
    {
        if (head)
        {
            std::pair<ListNode*, ListNode*> pairNode = quickSort(head);
            return pairNode.first;
        }
        else
        {
            return head;
        }
    }
private:
    // select the pivot node randomly
    ListNode* partitionNode(ListNode *head)
    {
        int sizeList = 0;
        ListNode* node = head;

        while (node)
        {
            ++sizeList;
            node = node->next;
        }

        // (rand() % (nHigh - nLow + 1)) + nLow   (inclusive)
        int p = rand() % (sizeList);
        ListNode* pNode = head;

        for (int i = 0; i != p; ++i)
        {
            pNode = pNode->next;
        }

        return pNode;
    }

    std::pair<ListNode*, ListNode*> quickSort(ListNode* head)
    {
        if (head->next == NULL) // single element list
        {
            return std::make_pair(head, head);
        }

        ListNode* pNode = partitionNode(head);

        // make a list of nodes whose value <= pNode->val
        // make a list of nodes whose value > pNode->val

        ListNode* headLeft = NULL;
        ListNode* nodeLeft = NULL;
        ListNode* headRight = NULL;
        ListNode* nodeRight = NULL;

        ListNode* node = head;
        while (node)
        {
            if (node != pNode)
            {
                if (node->val <= pNode->val)
                {
                    // append to left list
                    if (nodeLeft)
                    {
                        nodeLeft->next = node;
                        nodeLeft = node;
                    }
                    else
                    {
                        // adding head of left list
                        headLeft = node;
                        nodeLeft = node;
                    }
                }
                else
                {
                    // append to right list
                    if (nodeRight)
                    {
                        nodeRight->next = node;
                        nodeRight = node;
                    }
                    else
                    {
                        headRight = node;
                        nodeRight = node;
                    }
                }
            }
            node = node->next;
        }

        // now assign next of both list's tail as empty
        if (nodeLeft)
        {
            nodeLeft->next = NULL;
        }
        if (nodeRight)
        {
            nodeRight->next = NULL;
        }
        pNode->next = NULL;

        ListNode* tailLeft = nodeLeft;
        ListNode* tailRight = nodeRight;

        // Now sort the left and right list recursively
        if (headLeft)
        {
            std::pair<ListNode*, ListNode*> pairLeft = quickSort(headLeft);
            headLeft = pairLeft.first;
            tailLeft = pairLeft.second;
            tailLeft->next = pNode;
        }
        if (headRight)
        {
            std::pair<ListNode*, ListNode*> pairRight = quickSort(headRight);
            headRight = pairRight.first;
            tailRight = pairRight.second;
            pNode->next = headRight;
        }

        if (headLeft)
        {
            if (headRight)
            {
                return std::make_pair(headLeft, tailRight);
            }
            else
            {
                return std::make_pair(headLeft, pNode);
            }
        }
        else
        {
            if (headRight)
            {
                return std::make_pair(pNode, tailRight);
            }
            else
            {
                return std::make_pair(pNode, pNode);
            }
        }

    }

};


